import React, {useEffect,useState} from 'react'

function FetchApi() {
    
    const [details, setdetails] = useState(JSON)
    useEffect(() => {
        fetch('https://randomuser.me/api/?results=10')
        .then((info)=>{
            info.json().then((details)=>{
                details.results.push({Salary:'$100000'})
                setdetails(details);
                localStorage.setItem('userDetail',JSON.stringify(details.results));
            })
        })
    }, [])
    

  return (
    <div>
        {
          (details.length>0)&&details.map((obj)=>(
            
            <div>
              <h4>{obj.name.first}</h4>
            </div>
          ))
        }
    </div>
  )
}

export default FetchApi
